import React from "react";
import {Routes,Route } from "react-router-dom";
import Home from "./Component/Home";

const App =()=>{
    return(
        <>
           <Routes>
             <Route path="/" Component={Home}/>
           </Routes>
          <h1>Belymon Infotech</h1>
        </>
    )
}

export default App;
